import React from "react";
import { Typography, Box, Container, Paper, ButtonBase } from "@mui/material";
import { styled } from "@mui/system";
import { useNavigate } from "react-router-dom";
import theme from "../styles/theme";
import barbellIcon from "../Images/Login/23603572.png";

const MainContent = styled(Container)({
  padding: theme.spacing(3),
  backgroundColor: '#d2cfc9',
  maxWidth: '1400px',
  margin: 'auto',
  minHeight: '100vh',
});

const RowBox = styled(Box)({
  display: 'flex',
  justifyContent: 'space-between',
  marginBottom: theme.spacing(2),
});

const ButtonBox = styled(Paper)({
  width: '416px',
  height: '200px',
  padding: theme.spacing(2),
  display: 'flex',
  alignItems: 'center',
  justifyContent: 'center',
  backgroundColor: theme.palette.background.paper,
  borderRadius: theme.shape.borderRadius,
  overflow: '', // Ensure the hover effect is contained within the button
});

const StyledButtonBase = styled(ButtonBase)({
  display: 'block', // Ensure the button fills the container
  width: '100%',
  height: '100%',
  borderRadius: theme.shape.borderRadius,
  '&:hover': {
    transform: 'scale(1.05)',
    boxShadow: theme.shadows[6],
  },
  transition: 'transform 0.2s, box-shadow 0.2s',
});

const MyPlan = () => {
  const navigate = useNavigate();

  const handleButtonClick = (path) => {
    navigate(path); // Navigate to the specified path
  };

  return (
    <Box sx={{ backgroundColor: '#d2cfc9', minHeight: '100vh' }}>
      <MainContent>
        <Box display="flex" alignItems="center" mb={2}>
          <img src={barbellIcon} alt="Bulking Sensei" width="80" height="40" style={{ marginRight: theme.spacing(1) }} />
          <Typography variant="h6" sx={{ fontFamily: "Nanum Gothic, sans-serif" }}>
            Bulking Sensei
          </Typography>
        </Box>

        {/* Main Content Area */}
        <Box>
          {/* First Row */}
          <RowBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/')}>
                <Typography variant="h6">Button 1</Typography>
              </StyledButtonBase>
            </ButtonBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page2')}>
                <Typography variant="h6">Button 2</Typography>
              </StyledButtonBase>
            </ButtonBox>
          </RowBox>

          {/* Second Row */}
          <RowBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page3')}>
                <Typography variant="h6">Button 3</Typography>
              </StyledButtonBase>
            </ButtonBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page4')}>
                <Typography variant="h6">Button 4</Typography>
              </StyledButtonBase>
            </ButtonBox>
          </RowBox>

          {/* Third Row */}
          <RowBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page5')}>
                <Typography variant="h6">Button 5</Typography>
              </StyledButtonBase>
            </ButtonBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page6')}>
                <Typography variant="h6">Button 6</Typography>
              </StyledButtonBase>
            </ButtonBox>
          </RowBox>

          {/* Fourth Row */}
          <RowBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page7')}>
                <Typography variant="h6">Button 7</Typography>
              </StyledButtonBase>
            </ButtonBox>
            <ButtonBox elevation={3}>
              <StyledButtonBase onClick={() => handleButtonClick('/page8')}>
                <Typography variant="h6">Button 8</Typography>
              </StyledButtonBase>
            </ButtonBox>
          </RowBox>
        </Box>
      </MainContent>
    </Box>
  );
};

export default MyPlan;
